-styling, Jen and James uncover the unique features of the Dyson Corrale™ hair straightener. \n \nSay goodbye to excessive heat and hello to flexing plates. The Dyson Corrale™ straightener is designed to enhance styling with less damage to the hair. Its unique flexing plates shape to gather the hair so you can straighten at a lower temperature, without compromising on style. \n \nWhat’s more, discover the versatility of styling cord-free. The Dyson Corrale™ straightener delivers up to 30 minutes of cord-free styling, with the thermal performance of a corded straightener.¹ And if you need to style for longer, just attach the cable for hybrid charge mode. \n \nLearn more: \nhttps://www.dyson.com\n \n#DysonHair\n \nFollow on Instagram @Dysonhair\n \n¹ Exact run time depends on your hair and styling habits.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/xN1LApWol00/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLALbWNWrraeCofqDzgJgSsdWWpEIg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/xN1LApWol00/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLBT6jksOTTcpRd893NWHMJ7d5jluQ","width":196,"height":110},{"url":"https://i.ytimg.com/vi/xN1LApWol00/hqdefault.jpg?sqp=-oaymwEcCPYBEIoBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLA_ia8sKHO3qVHd2WSQQISbsKegbw","width":246,"height":138},{"url":"https://i.ytimg.com/vi/xN1LApWol00/hqdefault.jpg?sqp=-oaymwEcCNACELwBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLCyhvaPlR7E4SNFXamM46iPN249-g","width":336,"height":188},{"url":"https://i.ytimg.com/vi/xN1LApWol00/maxresdefault.jpg","width":1920,"height":1080}]},"allowRatings":true,"viewCount":"361227","author":"Dyson","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"0","endTimeMs":"1046000","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/iEDKBFjGOT-zdxU9RApxDA/featured_channel.
